 */

import { createMuiTheme } from '@material-ui/core/styles';
import yellow from '@material-ui/core/colors/yellow';

export const theme = createMuiTheme({
  typography: {
    fontFamily: "\"GlacialIndifference\"",
   },
  palette: {
    primary: {
      main: '#efeeee',
      dark: '#080218',
      contrastText: '#000',
    },
    secondary: {
      main: '#000',
      contrastText: '#efeeee',
    },
    background: {
      default: "#efeeee"
    },
  },
  overrides: {
    MuiStepLabel: {
      color: '#080218',
        label: {
            color: '#080218',
            '&$active': {
                color: '#000',
            },
            '&$completed': {
              color: '#000',
          },
        },
    },
},
});
